      "action": "speak",
      "input": "Would pick up washers."
    },
    {
      "action": "wait",
      "input": 5
    },
    {
      "action": "navigate",
      "input": {
        "name": "Starting Point",
        "x": 0,
        "y": 0
      }
    }
  ]
}

